import React, { useState } from "react";
import { assetData } from './testAssetData';
import './assetTabsStyles.css';

const CryptoTab = (props) => {

    const [selectedAsset, setSelectedAsset] = useState<AssetDataInterface>(null);

    return(
        <div className="assets-outer-container">
            <div className="assets-flex-container">
                {assetData.length > 0 && assetData.map((asset) => {
                    return(
                        <div className="asset-item-container">
                            <div className={props.selectedAsset && props.selectedAsset.name.toLowerCase() === asset.name.toLowerCase() ? 
                                "asset-item-inner-container active-asset" : 
                                "asset-item-inner-container inactive-asset"}>
                                <img src={asset.img} className="asset-img"/>
                                <p className="asset-label">
                                    {asset.name}
                                </p>
                            </div>
                        </div>
                    )
                })}
            </div>
        </div>
    );
}

export default CryptoTab;
